};

const drawerWidth = 240;

function ResponsiveDrawer(props) {
  const { window } = props;
  const [mobileOpen, setMobileOpen] = React.useState(false);
  const [isClosing, setIsClosing] = React.useState(false);

  const handleDrawerClose = () => {
    setIsClosing(true);
    setMobileOpen(false);
  };

  const handleDrawerTransitionEnd = () => {
    setIsClosing(false);
  };

  const handleDrawerToggle = () => {
    if (!isClosing) {
      setMobileOpen(!mobileOpen);
    }
  };

  const drawer = (
    <div style={{ display: 'flex', flexDirection: 'column', height: '100%' }}>
      <Toolbar>
        <img src={Logo} alt="Logo" style={{ width: '100%', height: 'auto' }} />
      </Toolbar>
      <Divider />
      <List sx={{ flexGrow: 1 }}>
        <ListItemButton sx={{
          '&:hover': {
            backgroundColor: '#535561',
          },
          '.MuiListItemText-primary, .MuiListItemText-secondary, .MuiListItemIcon-root': {
            color: '#AFB0B5',
          }
        }}>
          <ListItemText primary="List" />
          <IconButton edge="end" color="inherit">
            <AddBoxIcon style={{ color: '#AFB0B5' }} /> 
          </IconButton>
        </ListItemButton>
        <Divider />
        <ListItemButton sx={{
          '&:hover': {
            backgroundColor: '#535561'
          },
          '.MuiListItemText-primary, .MuiListItemText-secondary, .MuiListItemIcon-root': {
            color: '#AFB0B5',
          }
        }}>
          <ListItemIcon>
            <ContactsIcon />
          </ListItemIcon>
          <ListItemText primary="All Contacts" secondary="10,000" />
        </ListItemButton>
        <ListItemButton sx={{
          '&:hover': {
            backgroundColor: '#535561'
          },
          '.MuiListItemText-primary, .MuiListItemText-secondary, .MuiListItemIcon-root': {
            color: '#AFB0B5',
          }
        }}>
          <ListItemIcon>
            <CalendarMonthIcon />
          </ListItemIcon>
          <ListItemText primary="Event Organisation" secondary="6,000" />
        </ListItemButton>
        <ListItemButton sx={{
          '&:hover': {
            backgroundColor: '#535561'
          },
          '.MuiListItemText-primary, .MuiListItemText-secondary, .MuiListItemIcon-root': {
            color: '#AFB0B5',
          }
        }}>
          <ListItemIcon>
            <DrawIcon />
          </ListItemIcon>
          <ListItemText primary="UI/UX Design" secondary="10,000" />
        </ListItemButton>
        <ListItemButton sx={{
          '&:hover': {
            backgroundColor: '#535561'
          },
          '.MuiListItemText-primary, .MuiListItemText-secondary, .MuiListItemIcon-root': {
            color: '#AFB0B5',
          }
        }}>
          <ListItemIcon>
            <DevicesIcon />
          </ListItemIcon>
          <ListItemText primary="IT" secondary="6,000" />
        </ListItemButton>
        <ListItemButton sx={{
          '&:hover': {
            backgroundColor: '#535561'
          },
          '.MuiListItemText-primary, .MuiListItemText-secondary, .MuiListItemIcon-root': {
            color: '#AFB0B5',
          }
        }}>
          <ListItemIcon>
            <ChairIcon />
          </ListItemIcon>
          <ListItemText primary="Interior Design" secondary="3,000" />
        </ListItemButton>

      </List>
      {/* Logout */}
      <List>
        <Divider />
        <ListItemButton sx={{
          '&:hover': {
            backgroundColor: '#535561'
          },
          '.MuiListItemText-primary, .MuiListItemText-secondary, .MuiListItemIcon-root': {
            color: '#AFB0B5',
          }
        }}>
          <ListItemIcon>
            <LogoutIcon />
          </ListItemIcon>
          <ListItemText primary="Logout" />
        </ListItemButton>
      </List>
    </div>
  );

  const container = window !== undefined ? () => window().document.body : undefined;

  return (
    <Box sx={{ 
      width: { sm: drawerWidth }, 
      flexShrink: { sm: 0 },
      height: '100vh', // Set height to 100% of viewport height
      overflowY: 'auto', // Add vertical scroll if content exceeds viewport height
    }}>
      <CssBaseline />
      <AppBar
  position="fixed"
  sx={{
    width: { sm: `calc(100% - ${drawerWidth}px)` },
    ml: { sm: `${drawerWidth}px` },
    backgroundColor: '#000425', // Set the background color here
  }}
>
  <Toolbar>
    <IconButton
      color="inherit"
      aria-label="open drawer"
      edge="start"
      onClick={handleDrawerToggle}
      sx={{ mr: 2, display: { sm: 'none' } }}
    >
      <MenuIcon />
    </IconButton>

    <Avatar sx={{ ml: 'auto' }} alt="Profile Picture" src={profilePicture} />
    </Toolbar>
</AppBar>

<Box
  component="nav"
  sx={{ width: { sm: drawerWidth }, flexShrink: { sm: 0 } }}
  aria-label="mailbox folders"
>
  <Drawer
    container={container}
    variant="temporary"
    open={mobileOpen}
    onTransitionEnd={handleDrawerTransitionEnd}
    onClose={handleDrawerClose}
    ModalProps={{
      keepMounted: true,
    }}
    sx={{
      display: { xs: 'block', sm: 'none' },
      '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth, backgroundColor: '#000425' }, // Background color for mobile view
    }}
  >
    {drawer}
  </Drawer>
  <Drawer
    sx={{
      width: drawerWidth,
      flexShrink: 0,
      '& .MuiDrawer-paper': {
        width: drawerWidth,
        boxSizing: 'border-box',
        backgroundColor: '#000425', // Sidebar background color
        color: '#AFB0B5', // Text and icon color
      },
      display: { xs: 'none', sm: 'block' },
    }}
    variant="permanent"
    open
  >
    {drawer}
  </Drawer>
</Box>

      <Box
        component="main"
        sx={{ flexGrow: 1, p: 3, width: { sm: `calc(100% - ${drawerWidth}px)` } }}
      >
        <Toolbar />
        <Typography variant="h4"><b>Event Organisation</b></Typography>
  <div style={{ marginBottom: '20px' }}></div> {/* Add space between heading and button */}
  <Grid container alignItems="center" justifyContent="space-between" spacing={2}>
  {/* Search Bar */}
  <Grid item xs={12} sm={6} md={4} lg={3} sx={{ pl: 1 }}>
    <div style={{ position: 'relative', backgroundColor: '#D9D9D9', borderRadius: '20px', width: '100%' }}>
      <InputBase
        placeholder="Search..."
        fullWidth
        startAdornment={<SearchIcon sx={{ pl: 1 }} />}
        style={{ paddingRight: '30px' }}
      />
    </div>
  </Grid>

  {/* Add Button */}
  <Grid item xs={12} sm={6} md={4} lg={3}>
    <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end', width: '100%' }}>
      <Button
        variant="contained"
        style={{
          backgroundColor: '#000425',
          color: 'white',
          borderRadius: '20px',
          padding: '8px 12px', // Adjust padding for different screen sizes
          fontSize: '0.75rem', // Adjust font size for different screen sizes
        }}
        endIcon={<AddBoxIcon />}
      >
        Add new
      </Button>
    </div>
  </Grid>
</Grid>



  <div style={{ marginBottom: '20px' }}></div> {/* Add space between heading and table */}
  <div style={{ height: '100%', width: '100%', overflowX: 'auto' }}>
    <div style={{ minWidth: 800 }}> 
      <DataGrid
        rows={rows}
        columns={columns}
        pageSize={7}
        checkboxSelection
        headerClassName="boldHeader"
      />
    </div>
  </div>
      </Box>
    </Box>
  );
}

ResponsiveDrawer.propTypes = {
  window: PropTypes.func,
};

export default ResponsiveDrawer;
